import React from 'react';
import ReactDOM from 'react-dom';

function Card(){
    return(
        <div className="cards">   
        <div className="card">
            <img src="https://mcmscache.epapr.in/post_images/website_350/post_19329023/thumb.jpg"
                alt="mypic"
                className="card_img"
            />
                <div className="card_info">
                    <span className="card_category"> A Netflix Orignal Series</span>
                        <h3 className="card_title">Delhi Crime</h3>
                            <a href="https://www.netflix.com/in/title/81076756" target="_blank">
                                <button>Watch Now</button>
                            </a>

                </div>
        </div>
    </div>
    )
}
ReactDOM.render( <Card/> ,document.getElementById("root")
);
